class ColorScheme {
    constructor(name, colors) {
        this.key = name
        this.displayName = name.split('-').map(
            w => w.length === 1 ? w.toUpperCase() : w.charAt(0).toUpperCase() + w.slice(1)
        ).join(' ')
        this.colors = colors
        console.log("Created color scheme named " + this.displayName)
    }
}

export default ColorScheme
